    }
    function setAsNine()public {
        a=9 ;
    }

    //값을 출력하는 함수.

    function getA ()public view returns (uint) {
        return a;
    }
    function getB () public view returns (uint ) {
        return b;
    }

    function getAB () public view returns (uint,uint) {
        return (a,b);
    }
}

